import React from 'react';
import './worker-profile.css'
import Navbar from "./../../components/navbar/Navbar";
import Breadcrumb from "../../components/breadcrumb/Breadcrumb";
import Footer from "../../components/footer/Footer";

const WorkerProfile = (props) =>{

  // Retrieve worker data from props
  // const { name, service, image, salary, description, area } = props.workerData;

  return (
    <>
<Navbar />
       <Breadcrumb title="Worker Profile" />
       <div>
        <div>
        <img src='www.abc.com/img.png'></img>
        <p>Availability: </p>
        </div>
        <div></div>
       </div>

    <div>
     
      <h6>Name</h6>
      <p>Service: Driver</p>
      <p>About: </p>
      <p>Address: </p>
      <p>Service Area: </p>
      <p>Working Since:</p>
      <p>Total Expereince:</p>
      <p>Expecting Salary /month: 20000</p>
     
      <p>Contact No:</p>
      {/* <p>CNIC: </p> */}
      <p>Reviews: </p>
    </div>


    {/* // <div>
    //   <h2>{name}</h2>
    //   <img src={image} alt={name} />
    //   <p>Service: {service}</p>
    //   <p>Salary: {salary}</p>
    //   <p>Description: {description}</p>
    //   <p>Area: {area}</p>
    // </div> */}
    <Footer />
    </>
  );
}

export default WorkerProfile;
